function extractNavigation() {
  return Array.from(document.querySelectorAll('main a[href*="/collections/"]'))
    .filter(link => {
      const url = link.href;
      return url && !url.includes('?') && !url.includes('/products/') && link.textContent?.trim();
    })
    .map(link => ({
      name: link.textContent.trim(),
      url: link.href,
      children: []
    }))
    .filter((item, index, arr) => arr.findIndex(i => i.url === item.url) === index);
}
